    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]
    elif n == 2:
        return [1, 3, 2]

    trib = [1, 3, 2]
    for i in range(3, n + 1):
        if i % 2 == 0:
            trib.append(1 + i // 2)
        else:
            next_value = trib[i - 1] + trib[i - 2] + trib[i - 3]
            trib.append(next_value)
    return trib

def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if not stack:
                return False
            stack.pop()
    # After processing all characters, if the stack is not empty, 
    # it means there are unmatched opening brackets.
    if stack:
        return False

    # Checking for nested brackets requires ensuring there's a point where 
    # the stack depth is greater than 1.
    depth = 0
    max_depth = 0
    for char in string:
        if char == '[':
            depth += 1
            max_depth = max(max_depth, depth)
        elif char == ']':
            depth -= 1
    return max_depth > 1

