def get_closest_vowel(word):
    vowels = "aeiouAEIOU"
    closest_vowel = ""
    min_distance_to_end = len(word)

    for i in range(1, len(word) - 1):
        if word[i] in vowels and word[i-1] not in vowels and word[i+1] not in vowels:
            distance_to_end = len(word) - i - 1
            if distance_to_end < min_distance_to_end:
                closest_vowel = word[i]
                min_distance_to_end = distance_to_end
    return closest_vowel

def intersection(interval1, interval2):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    start1, end1 = interval1
    start2, end2 = interval2
    start = max(start1, start2)
    end = min(end1, end2)
    if start > end:
        return "NO"
    length = end - start
    return "YES" if is_prime(length) else "NO"

def match_parens(lst):
    str1, str2 = lst
    # Check if first string can be balanced by the second
    def can_balance(s1, s2):
        balance = 0
        for char in s1:
            if char == '(':
                balance += 1
            else:
                balance -= 1
            # If balance goes negative, s1 cannot be balanced by s2
            if balance < 0:
                return False
        # Check if the remaining string can balance the first one
        for char in s2:
            if char == '(':
                balance += 1
            else:
                balance -= 1
        return balance == 0

    # Check both possible concatenations
    return 'Yes' if can_balance(str1, str2) or can_balance(str2, str1) else 'No'

