def cycpattern_check(a, b):
    if len(b) > len(a):
        return False
    extended_a = a + a
    # Check if b is in the extended_a without rotation, as a preliminary step.
    if b in extended_a:
        return True
    # Check for rotations of b being a substring of a.
    for i in range(1, len(b)):  # Start from 1 since 0 would be the original b, already checked.
        rotated_b = b[i:] + b[:i]
        if rotated_b in extended_a:
            return True
    return False

def max_fill(grid, capacity):
