def tri(n):
    if n == 0: return [1]
    if n == 1: return [1, 3]
    if n == 2: return [1, 3, 2]

    trib = [1, 3, 2]
    for i in range(3, n + 1):
        if i % 2 == 0:
            trib.append(int(1 + i / 2))
        else:
            next_val = trib[i - 1] + trib[i - 2] + trib[i - 3]
            trib.append(next_val)
    return trib

def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if not stack:
                # If the stack is empty when we encounter a ']', it means the brackets are not properly nested.
                return False
            stack.pop()
    # After processing all characters, check if stack is empty and there was at least one '[' character.
    # The string is considered to have nested brackets only if the stack is empty (all brackets closed)
    # and the length of the string is greater than 2 (at least one set of brackets is nested inside another).
    return not stack and len(string) > 2

