def is_prime(n):
    """Return true if a given number is prime, and false otherwise."""
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True

def prime_fib(n: int) -> int:
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    def fib():
        a, b = 0, 1
        while True:
            yield a
            a, b = b, a + b

    count = 0
    for fib_num in fib():
        if fib_num > 1 and is_prime(fib_num):
            count += 1
            if count == n:
                return fib_num

def triples_sum_to_zero(l: list):
    n = len(l)
    l.sort()
    for i in range(n-2):
        left = i + 1
        right = n - 1
        while left < right:
            current_sum = l[i] + l[left] + l[right]
            if current_sum == 0:
                return True
            elif current_sum < 0:
                left += 1
            else:
                right -= 1
    return False

