def largest_prime_factor(n: int) -> int:
    """Return the largest prime factor of n. Assume n > 1 and is not a prime."""
    def is_prime(num):
        if num <= 1:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    prime_factor = 1
    i = 2

    while i <= n ** 0.5:
        if n % i == 0 and is_prime(i):
            prime_factor = i
            while n % i == 0:
                n //= i
        i += 1

    if n > 2 and is_prime(n):
        prime_factor = n

    return prime_factor

