def search(lst):
    count_dict = {}
    for num in lst:
        if num in count_dict:
            count_dict[num] += 1
        else:
            count_dict[num] = 1

    max_val = -1
    for key, value in count_dict.items():
        if key <= value and key > max_val:
            max_val = key

    return max_val

