        elif char == ']':
            if stack:  # Only pop if the stack is not empty
                stack.pop()
                # If after popping, the stack is not empty, it means there's a nested structure
                if stack:
                    nested = True
            else:
                # If trying to pop from an empty stack, the sequence is invalid
                return False
    # The string is valid if the stack is empty and we have seen a nested pair
    return nested and not stack

