def match_parens(lst):
    str1, str2 = lst
    # First, check if the total number of '(' matches the total number of ')'
    total_open = str1.count('(') + str2.count('(')
    total_close = str1.count(')') + str2.count(')')
    if total_open != total_close:
        return 'No'

    # Check if str1 can be a valid start
    balance = 0
    for char in str1:
        if char == '(':
            balance += 1
        else:
            balance -= 1
        if balance < 0:
            break

    # If str1 is valid or can be made valid by str2, check the combination
    if balance >= 0:
        for char in str2:
            if char == '(':
                balance += 1
            else:
                balance -= 1
            if balance < 0:
                break
        if balance == 0:
            return 'Yes'

    # Reset balance and try starting with str2
    balance = 0
    for char in str2:
        if char == '(':
            balance += 1
        else:
            balance -= 1
        if balance < 0:
            break

    # If str2 is valid or can be made valid by str1, check the combination
    if balance >= 0:
        for char in str1:
            if char == '(':
                balance += 1
            else:
                balance -= 1
            if balance < 0:
                break
        if balance == 0:
            return 'Yes'

    # If neither combination works, return 'No'
    return 'No'

