        elif char == ']':
            if stack:
                stack.pop()
                nested = True  # Found a nested pair
            else:
                # Early return if unbalanced ']' is found
                return False
    # Return True if nested pair was found and stack is empty (all brackets are closed)
    return nested and not stack

