    """
    # Generate the array
    a = [i * i - i + 1 for i in range(1, n + 1)]
    count = 0

    # Iterate through all possible triples
    for i in range(n):
        for j in range(i + 1, n):
            for k in range(j + 1, n):
                if (a[i] + a[j] + a[k]) % 3 == 0:
                    count += 1
    return count

def split_words(txt):
    # Check for whitespace
    if ' ' in txt:
        return txt.split()
    # Check for commas
    elif ',' in txt:
        return txt.split(',')
    else:
        # Correctly count lower-case odd order letters
        return sum(1 for char in txt if char.islower() and (ord(char) - ord('a')) % 2 != 0)

def get_closest_vowel(word):
    vowels = "aeiouAEIOU"
    # Start from the second last character to avoid IndexError for word[i+1]
    for i in range(len(word) - 2, 0, -1):
        if word[i] in vowels and word[i-1] not in vowels and word[i+1] not in vowels:
            return word[i]
    return ""

def intersection(interval1, interval2):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    start1, end1 = interval1
    start2, end2 = interval2
    start = max(start1, start2)
    end = min(end1, end2)
    if start > end:
        return "NO"
    length = end - start
    return "YES" if is_prime(length) else "NO"

def maximum(arr, k):
    """
    Given an array arr of integers and a positive integer k, return a sorted list 
    of length k with the maximum k numbers in arr, sorted in ascending order.
    """
    if k == 0:
        return []
    else:
        return sorted(arr)[-k:]

def match_parens(lst):
    str1, str2 = lst
    # Check each permutation of the concatenation
    for s in [str1 + str2, str2 + str1]:
        balance = 0
        for char in s:
            if char == '(':
                balance += 1
            else:
                balance -= 1
            # If balance goes negative, parentheses are not properly matched
            if balance < 0:
                break
        # If balance is zero after processing all characters, it's a good string
        if balance == 0:
            return 'Yes'
    return 'No'

def find_max(words):
    def unique_characters(word):
        return len(set(word)), -words.index(word)
    return max(sorted(words), key=unique_characters, default="")

def max_fill(grid, capacity):
    import math
    total_water_units = sum(sum(row) for row in grid)
    return math.ceil(total_water_units / capacity)

def cycpattern_check(a, b):
    if len(b) > len(a):
        return False
    extended_a = a + a
    # Generate all rotations of b and check each rotation if it is a substring of extended_a
    for i in range(len(b)):
        rotated_b = b[i:] + b[:i]
        if rotated_b in extended_a:
            return True
    return False

def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if not stack:
                return False
            stack.pop()
    # A valid nested structure requires at least one '[' to be inside another pair of brackets.
    # This means the length of the stack should be at least 1 after removing all matching pairs.
    return len(stack) < len(string) // 2

def tri(n):
    if n == 0:
        return [1]
    if n == 1:
        return [1, 3]
    if n == 2:
        return [1, 3, 2]

    trib = [1, 3, 2]
    for i in range(3, n + 1):
        if i % 2 == 0:
            trib.append(1 + i // 2)
        else:
            trib.append(trib[i - 1] + trib[i - 2] + trib[i - 3])
    return trib
